import React from 'react';
import JournalEntries from "./JournalEntries";

const Sidebar = () => {
    return (
        <aside className="journal-sidebar d-flex">
            <div>
                <div className="journal-sidebar-navbar d-flex justify-content-between">
                    <h3 className="mt-5">
                        <i className="far fa-moon"></i>
                        <span> Fernando</span>
                    </h3>

                    <div>
                        <button className="btn text-white">
                            Logout
                        </button>
                    </div>
                </div>

                <div className="journal-new-entry d-flex justify-content-center mt-4 w-100 align-items-center flex-column">
                    <i className="far fa-calendar-plus fa-5x"></i>
                    <p className="mt-5">
                        New entry
                    </p>
                </div>

            </div>

            <br />
            <JournalEntries />
        </aside>
    );
};

export default Sidebar;
